import React from "react";
import carServices from "../services/carServices";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Car from "../Pages/car.js";

class CarComponent extends React.Component {

        constructor(props) {
            super(props)
            this.state = {
                cars:[]
            }
        }

        componentDidMount() {
            carServices.getCars().then((response) => {
                this.setState({cars: response.data})
            });
        }

        render (){
            return (
                <Router>
                <div>
                    <h1>AutoShow.by</h1>
                    <div class="cars">
                    {
                                this.state.cars.map(
                                    car =>
                                    <div class="car" key = {car.id}>
                                        <div class="car-info">
                                            <h4><Link to="/car/{car.id}"> {car.carBrand} {car.model}</Link></h4>
                                            <p>Год выпуска: {car.yearRelease}</p>
                                            <p>Цена: {car.prise}</p>
                                        </div>
                                        <div class="car-img">
                                            <p><img src ={car.imageCar}></img></p>
                                        </div>
                                    </div>
                                )
                            }
                    </div>
                    <Routes>
                        <Route exact element={<Car/>} />
                    </Routes>
    
                </div>
                </Router>
            )
        }
}

export default CarComponent
